INSERT INTO toa_blog VALUES ('60','唐义[政策法规处] 2014-07-21工作日志','<p>参加局务会，汇报全国扶贫办主任座谈会精神，按会议要求向省领导撰写情况报告和工作建议；</p>\r\n<p>送审张局长在省委农村工作领导小组会上大发言材料、半年工作总结及下半年打算；</p>\r\n<p>向省委办公厅报送四川省农村扶贫开发情况；向省政府办公厅报送上半年工作情况；</p>\r\n<p>召开处务会传达局务会精神，安排本周任务。</p>','9','全部人员','2','2014-07-21','2');
INSERT INTO toa_blog VALUES ('62','刘燕[信息统计处] 2014-07-22 工作日志','<p>1.全省扶贫开发建档立卡现场会议方案</p>\r\n<p>2.全省扶贫开发建档立卡情况通报</p>\r\n<p>3.建档立卡指标体系培训会议网站信息审核</p>\r\n<p>4.研究贫困村分类办法</p>','0','全部人员','1','2014-07-22','54');
INSERT INTO toa_blog VALUES ('61','唐义[政策法规处] 2014-07-22 工作日志','<p>向局领导呈送相关材料；</p>\r\n<p>协调到省外调研移民立法事项；</p>\r\n<p>向省委报送局机关学习省委理论中心组学习情况；</p>\r\n<p>协调川台、发展网记者采访彝区、《扶贫条例》等事项；</p>\r\n<p>在机关办公。</p>','14','张谷,刘兵,邹积立,何智彬,向伟益,刘维嘉,张华林,杨晖,都勤,廖蔚,何大清,郭全喜,张海鹏,汪社林,唐义,张兵,罗薇,吴勇,杨萍,侯军,李征宇,董乾生,杨铧','2','2014-07-22','2');
