INSERT INTO toa_blog VALUES ('64','李抒玲[国际合作与社会扶贫处] 2014-07-22 工作日志','1.与人行对接金融扶贫改革加入三项政策的事情，待我局形成一致意见再提交人行，再衔接涉及的相关部门。<br />\r\n2。添加完善金融扶贫改革三项政策内容，发计划财务处、扶贫开发指导处修改。<br />\r\n3.呈相关局领导审示后，发送人行。<br />\r\n4.22日－25日，浙江省来四川考察人员一行分别到阿坝州、甘孜考察。','11','全部人员','2','2014-07-22','65');
INSERT INTO toa_blog VALUES ('65','张海鹏[局领导] 2014-07-22 工作日志','<p>1、上午9点参加张局长临时召集会议，进一步明确近期相关重点工作；</p>\r\n<p>2、随张局长慰问解放同志家属；</p>\r\n<p>3、与唐义处长商议次日下午召开《四川扶贫移民》3期小结评议、4期选题会议；</p>\r\n<p>4、下午到社扶处研究相关工作推进事项；</p>\r\n<p>一是《创新金融服务机制意见》已与人行衔接，把信贷、贴息、风险基金和互助资金四方面政策具体化，写进《意见》中，并立即与相关部门衔接，力争促成发文；</p>\r\n<p>二是《创新社会帮扶机制意见》，按照省领导批示精神，立即与14个部门会签，然后以省府办名义转发；</p>\r\n<p>三是定点扶贫表扬会，继续与省委组织部衔接，做好相关准备工作；</p>\r\n<p>四是审核签报（发）《结对认亲、爱心帮扶活动（试行）方案》；</p>\r\n<p>五是签发与省委组织在浙大联合举办的《四川藏区幸福美丽乡村培训班（第二期）》通知，在省委党校举办的《四川藏区乡村干部、致富带头人培训班（第一期）》通知。</p>\r\n<p>六是安排浙川东西扶贫协作项目统计工作培训班事项。</p>','10','张谷,刘兵,邹积立,何智彬,向伟益,刘维嘉,张华林,杨晖,都勤,廖蔚,何大清,郭全喜,张海鹏,汪社林,唐义,张兵,罗薇,吴勇,杨萍,侯军,李征宇,董乾生,杨铧,王正洪,李抒玲,杨丽,覃佳,罗宇,汪明辉,刘昱','2','2014-07-22','28');
INSERT INTO toa_blog VALUES ('66','吴勇[政策法规处] 2014-07-23 工作日志','<p>1.修改省委农村工作领导小组会议发言材料、上半年扶贫开发工作情况及下半年打算、农业农村重大项目推进情况表，报请局领导审定后报送省委农工委。</p>\r\n<p>2.修改《四川省农村扶贫开发工作有关情况》报省委办公厅综合室供中央巡视组参阅。</p>\r\n<p>3.参加局务会，处务会。</p>','4','张谷,刘兵,邹积立,何智彬,向伟益,刘维嘉,张华林,杨晖,都勤,廖蔚,何大清,郭全喜,张海鹏,汪社林,韩峰,周美川,曾文兵,唐义,张兵,罗薇,吴勇,杨萍,侯军,李征宇,董乾生,杨铧,陈彦,黄宇,薛兵,朱蓉,潘晔,李灵英,吴守清,刘燕,李华聪,王强,王正洪,李抒玲,罗宇,汪明辉,李庆友,蒋光文,张潇元,彭静耘,姚立,曾磊,雷蕾,曾维忠,蒲熹漫,李宇,林勇,陈宝敬,杨邦华,刘晓春,朱建凌,王思铁,向兴华,冯克努,罗斯华,胥谊,王俊赛,王鹏,耿福元,张德华','2','2014-07-21','34');
INSERT INTO toa_blog VALUES ('67','吴勇[政策法规处] 2014-07-23 工作日志','<p><span style=\"font-family:FangSong_GB2312;font-size:16px;\">1.修改《关于贯彻落实省委理论中心组</span><span style=\"font-family:FangSong_GB2312;font-size:16px;mso-hansi-font-family:方正小标宋简体;mso-bidi-font-family:方正小标宋简体;\">专题学习会精神有关情况<span style=\"font-family:FangSong_GB2312;color:black;font-size:16px;\">的报告<span lang=\"EN-US\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></span></span></span><span style=\"font-family:FangSong_GB2312;font-size:16px;\">》。</span></p>\r\n<p><span style=\"font-family:FangSong_GB2312;font-size:16px;\">2.参加刘维嘉副局长组织研究扶贫开发工作。</span></p>\r\n<p><span style=\"font-family:FangSong_GB2312;font-size:16px;\">3.研究起草落实“五大扶贫工程<span style=\"font-family:FangSong_GB2312;font-size:16px;\">”12项重点工作的意见。</span></span></p>','7','','2','2014-07-22','34');
