INSERT INTO toa_news VALUES ('26','0','0','','四川省扶贫和移民工作局关于开展“培育社会主义核心价值观、做人民满意公务员”主题培训的通知','<p style=\"text-align:center;line-height:24pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:宋体;font-size:22pt;\">四川省扶贫和移民工作局<span lang=\"EN-US\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></span></span></b></p>\r\n<p style=\"text-align:center;line-height:24pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:宋体;font-size:22pt;\">关于开展“培育社会主义核心价值观、做人民满意公务员”主题培训的通知<span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p style=\"line-height:24pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\" lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\r\n<p style=\"line-height:24pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">各处（室、委）：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:24pt;text-indent:31.5pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">按照省公务员局《关于开展“培育社会主义核心价值观、做人民满意公务员”主题培训的通知》，现将局机关处级及以下公务员（不含工勤、下派人员）“培育社会主义核心价值观、做人民满意公务员”主题培训安排及要求通知如下：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:24pt;text-indent:31.5pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">一、根据省公务员局要求，省政府部门主题培训依托四川人事人才培训网公务员培训平台开展，培训时间<?xml:namespace prefix = st1 ns = \"urn:schemas-microsoft-com:office:smarttags\" /><st1:chsdate w:st=\"on\" isrocdate=\"False\" islunardate=\"False\" day=\"1\" month=\"6\" year=\"2014\"><span lang=\"EN-US\">2014</span>年<span lang=\"EN-US\">6</span>月<span lang=\"EN-US\">1</span>日</st1:chsdate>至<st1:chsdate w:st=\"on\" isrocdate=\"False\" islunardate=\"False\" day=\"30\" month=\"11\" year=\"2014\"><span lang=\"EN-US\">11</span>月<span lang=\"EN-US\">30</span>日</st1:chsdate>；测试在培训平台上进行，试卷通过题库系统随机生成，每位学员的测试题不完全相同，测试时间为<span lang=\"EN-US\">120</span>分钟。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:24pt;text-indent:31.5pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">二、测试结束，请自行打印证书（成绩单），以处（室、委）为单位汇总，报局人事处。培训结束后<span lang=\"EN-US\">1</span>个月内人事处将测试结果报省公务员局备案。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:24pt;text-indent:31.5pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">三、省公务员局将不定期对培训情况进行抽查，并适时对参训情况进行统计整理，培训结束后反馈给各参训单位。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:24pt;text-indent:31.5pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">四、测试不合格的，年度考核不得确定为优秀等次；无正当理由不参加培训的，给予通报批评；省政府部门在向省公务员局报送年度考核结果备案时，优秀等次人员须附测试成绩。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:24pt;text-indent:31.5pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">附件：<span lang=\"EN-US\">1.</span>省政府部门公务员网络培训操作说明<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:24pt;text-indent:31.5pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\" lang=\"EN-US\"><span style=\"mso-spacerun:yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>2.</span><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">学员卡号及激活码<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:24pt;text-indent:31.5pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\" lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\r\n<p style=\"line-height:24pt;text-indent:215.2pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:13.45;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">四川省扶贫和移民工作局<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:24pt;text-indent:247.2pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:15.45;\" class=\"MsoNormal\"><st1:chsdate w:st=\"on\" isrocdate=\"False\" islunardate=\"False\" day=\"11\" month=\"6\" year=\"2014\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;\" lang=\"EN-US\">2014</span><span style=\"font-family:仿宋_GB2312;font-size:16pt;\">年<span lang=\"EN-US\">6</span>月<span lang=\"EN-US\">11</span>日</span></st1:chsdate><span style=\"font-family:仿宋_GB2312;font-size:16pt;\" lang=\"EN-US\"><o:p></o:p></span></p>','data/uploadfile/88/20140613/20140613023236.zip','4','2014-06-13 10:32:44','88','0');
