INSERT INTO toa_news VALUES ('25','0','0','','关于报送2014年上半年工作总结及下半年工作计划的通知','<p style=\"text-align:center;line-height:30pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:华文中宋;font-size:22pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">关于报送</span></span></b><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:\'Times New Roman\';font-size:22pt;mso-fareast-font-family:华文中宋;\" lang=\"EN-US\">2014</span></b><span style=\"font-family:Calibri;\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:华文中宋;font-size:22pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">年上半年工作总结</span></b><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:\'Times New Roman\';font-size:22pt;mso-fareast-font-family:华文中宋;\" lang=\"EN-US\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></span></b></span></p>\r\n<p style=\"text-align:center;line-height:30pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family:Calibri;\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:华文中宋;font-size:22pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">及下半年工作计划的通知</span></b><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:\'Times New Roman\';font-size:22pt;mso-fareast-font-family:华文中宋;\" lang=\"EN-US\"><o:p></o:p></span></b></span></p>\r\n<p style=\"text-align:center;line-height:30pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family:\'Times New Roman\';font-size:9pt;mso-fareast-font-family:方正小标宋_GBK;\" lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>\r\n<p style=\"line-height:30pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:Calibri;\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">各处（室、委）、中心：</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:Calibri;\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">为认真总结今年上半年全省扶贫移民工作开展情况，切实理清下半年工作思路，进一步强化工作措施和责任落实，确保年度各项工作任务全面完成，按照局领导的指示，现就报送上半年工作总结及下半年工作计划的有关事项通知如下。</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:黑体;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">一、报送要点</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:黑体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"line-height:30pt;text-indent:32.15pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">（一）上半年工作绩效。</span></b><span style=\"font-family:Calibri;\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">要对照年初工作部署和年度计划，结合岗位职能职责，认真梳理、全面总结扶贫移民重大决策、重点工作、常规项目落实情况和工作绩效。</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:30pt;text-indent:32.15pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">（二）工作中存在的问题。</span></b><span style=\"font-family:Calibri;\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">针对扶贫移民工作新形势、新特点、新要求，深入查找和分析扶贫移民工作推进和机关建设等方面存在的问题和原因。</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:30pt;text-indent:32.15pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">（三）下半年工作计划。</span></b><span style=\"font-family:Calibri;\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">要联系实际，广泛讨论，科学谋划，提出下半年的工作思路和具体措施。</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:黑体;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">二、报送要求</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:Calibri;\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">（一）各处（室、委）、中心要高度重视，认真研究，组织专门力量，对上半年工作进行认真深入地总结，实事求是地总结成绩和经验，认真梳理存在问题和不足，科学谋划下半年工作，力求材料能全面、系统反映实际工作。</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">（二）所报材料要体现工作特色和亮点，做到重点突出、文字精炼、内容详实、条理清楚、数据准确。数据以</span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\">6</span><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">月</span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\">30</span><span style=\"font-family:Calibri;\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">日为截止时间，可适当估算。</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">（三）所报材料的字数请控制在</span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\">3000</span><span style=\"font-family:Calibri;\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">字以内，报局分管领导审阅签字后报送。</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:黑体;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:黑体;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">三、报送方式</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:黑体;\" lang=\"EN-US\"><o:p></o:p></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">请各处（室、委）、中心于</span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\">2014</span><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">年</span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\">6</span><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">月</span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\">20</span><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">日前，以书面材料和电子文档形式送政策法规处</span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\">202</span><span style=\"font-family:Calibri;\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\">室。</span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-align:left;line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">联系人：董乾生</span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:仿宋_GB2312;\" lang=\"EN-US\"><span style=\"mso-spacerun:yes;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;\" lang=\"EN-US\">Email:709264998@qq.com<span style=\"mso-spacerun:yes;\">&nbsp; </span><o:p></o:p></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋_GB2312;font-size:16pt;mso-ascii-font-family:\'Times New Roman\';mso-hansi-font-family:\'Times New Roman\';\"><span style=\"font-family:Calibri;\">特此通知。</span></span><span style=\"font-family:\'Times New Roman\';font-size:16pt;mso-fareast-font-family:\'Arial Unicode MS\';\" lang=\"EN-US\"><span style=\"mso-spacerun:yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><o:p></o:p></span></p>\r\n<p style=\"line-height:30pt;text-indent:32pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;ms