INSERT INTO toa_news VALUES ('32','0','张谷,刘兵,邹积立,何智彬,向伟益,刘维嘉,张华林,杨晖,都勤,廖蔚,何大清,郭全喜,张海鹏,汪社林,韩峰,周美川,李洁,曾文兵,唐义,张兵,陈彦,薛兵,朱蓉,黄河,吴守清,刘燕,李华聪,王强,李庆友,刘伯庆,何成俊,刘莉,侯毅,李重庆,左绪海,余琳,姚立,曾磊,雷蕾,杨邦华,刘晓春,朱建凌,罗斯华,胥谊,王俊赛,敬松,王鹏,耿福元','','全省主汛期防汛暨山洪地质灾害防治工作电视电话会议精神贯彻落实','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-family:SimSun;font-size:18px;\">经张谷局长同意，2014年7月14日</span><span style=\"font-family:SimSun;font-size:18px;\">第14次局务会议传达，并安排我局工作组到市（州</span><span style=\"font-family:SimSun;font-size:18px;\">）、县时把“移民安全度汛”</span><span style=\"font-family:SimSun;background:#ffffff;font-size:18px;mso-spacerun:\'yes\';mso-shading:#ffffff;\">作为检查指导内容。</span></p>\r\n<!--EndFragment-->','data/uploadfile/76/20140715/20140715004003.PDF','3','2014-07-15 08:53:25','76','0');
INSERT INTO toa_news VALUES ('33','0','0','','四川省扶贫和移民工作局关于进一步深化专项整治工作切实解决执行不力和侵害群众切身利益问题的通知','<p style=\"margin:0cm 0cm 0pt;layout-grid-mode:char;mso-layout-grid-align:none;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p><span style=\"font-family:\'Times New Roman\';\">&nbsp;</span></o:p></span></p>\r\n<p style=\"text-align:center;margin:0cm 0cm 0pt;layout-grid-mode:char;\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family:方正小标宋简体;font-size:22pt;mso-hansi-font-family:仿宋;\">四川省扶贫和移民工作局<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-align:center;margin:0cm 0cm 0pt;layout-grid-mode:char;\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family:方正小标宋简体;font-size:22pt;mso-hansi-font-family:仿宋;\">关于进一步深化专项整治工作切实解决<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-align:center;margin:0cm 0cm 0pt;layout-grid-mode:char;\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family:方正小标宋简体;font-size:22pt;mso-hansi-font-family:仿宋;\">执行不力和侵害群众切身利益问题的通知<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"margin:0cm 0cm 0pt;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\"><o:p><span style=\"font-family:\'Times New Roman\';\">&nbsp;</span></o:p></span></p>\r\n<p style=\"margin:0cm 0cm 0pt;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">各市（州）扶贫移民工作局（办），各处（室、委）、中心：<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">根据省委党的群众路线教育实践活动领导小组《关于在第二批教育实践活动中深化正风肃纪工作切实解决<span lang=\"EN-US\">“</span>四风<span lang=\"EN-US\">”</span>突出问题的通知》（川委群组发〔<span lang=\"EN-US\">2014</span>〕<span lang=\"EN-US\">10</span>号）和《关于印发<span lang=\"EN-US\">&lt;</span>教育实践活动指导工作任务分工方案<span lang=\"EN-US\">&gt;</span>的通知》（川委群办发〔<span lang=\"EN-US\">2014</span>〕<span lang=\"EN-US\">21</span>号）要求，结合省局在指导基层扶贫移民部门开展党的群众路线教育实践活动中发现的问题，经研究，决定在全省扶贫移民系统进一步深化群众路线教育实践活动，切实开展解决执行不力和侵害群众切身利益问题的专项整治活动。现将专项整治工作有关事项通知如下：<span lang=\"EN-US\"> <o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:黑体;font-size:16pt;mso-hansi-font-family:黑体;\">一、目标任务<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">重点整治慵懒散拖、推诿扯皮，作风漂浮、工作不实，不作为、慢作为、乱作为，不深入实际、漠视群众疾苦，有令不行、有禁不止、阳奉阴违、政令不畅、搞<span lang=\"EN-US\">“</span>上有政策、下有对策<span lang=\"EN-US\">”</span>等执行不力和侵害群众切身利益的问题。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:25.15pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.58;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（一）扶贫工作方面。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">切实解决贫困村、贫困户精准识别、建档立卡工作推进缓慢，扶贫项目挂包责任落实不到位，项目资金截留、挤占、挪用，到村入户精准扶持不准，<span lang=\"EN-US\">“</span>五级<span lang=\"EN-US\">”</span>公示公告制执行不严，群众知情权、参与权、监督权落实不到位的问题。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:26.55pt;margin:0cm 0cm 0pt;tab-stops:31.05pt;mso-char-indent-count:1.67;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（二）移民工作方面。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;tab-stops:31.05pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">切实解决政策梳理、宣传、解读不够，移民实物指标调查不严、不实，规划（计划）调整变更不报批，工程项目推进缓慢、竣工结算迟缓，新增后扶人口审核不及时等问题。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:黑体;font-size:16pt;mso-hansi-font-family:黑体;\">二、整改措施<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（一）精准识别，建档立卡。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-align:left;text-indent:31.7pt;margin:0cm 0cm 0pt;mso-layout-grid-align:none;mso-char-indent-count:2.0;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:仿宋;font-size:16pt;mso-font-kerning:0pt;mso-ansi-language:ZH-CN;\"><span style=\"font-family:\'Times New Roman\';\">1．加强指导督查。按照“省抽查、市督查、县核查”的方法，各县（市、区）要加强对乡（镇）扶贫开发建档立卡工作的指导和督促，对进度缓慢的乡（镇）要实行蹲点指导；各市（州）要派出督导组对各县（市、区）扶贫开发建档立卡工作进行巡查指导；省局要组织督查组对各地开展扶贫开发建档立卡工作进行抽查，确保工作进度和质量。<o:p></o:p></span></span></p>\r\n<p style=\"text-align:left;text-indent:31.7pt;margin:0cm 0cm 0pt;mso-layout-grid-align:none;mso-char-indent-count:2.0;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:仿宋;font-size:16pt;mso-font-kerning:0pt;mso-ansi-language:ZH-CN;\"><span style=\"font-family:\'Times New Roman\';\">2．建立工作台账。为掌握全省工作动态，各市（州）要以县（市、区）为单位建立扶贫开发建档立卡工作进度台账，对前期准备和识别阶段工作实行1周1报制度，对结对帮扶、系统管理和监督检查阶段实行2周1报制度。<o:p></o:p></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;mso-font-kerning:0pt;mso-ansi-language:ZH-CN;\">3．引入第三方力量参与监督。充分发挥驻村工作队作用，全程参与扶贫对象建档立卡工作，并进行全方位监督。</span><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:22.3pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.4;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（二）精准扶持，分类指导。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">1</span><span style=\"font-family:仿宋;font-size:16pt;\">．对建档立卡贫困村、贫困户进行分类指导，针对不同致贫原因，因村因户施策，采取量身定制和一对一帮扶的方式，制定切实可行的帮扶措施，切实加大直接扶持的力度，变<span lang=\"EN-US\">“</span>大水漫灌<span lang=\"EN-US\">”</span>为<span lang=\"EN-US\">“</span>精确滴灌<span lang=\"EN-US\">”</span>。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">2</span><span style=\"font-family:仿宋;font-size:16pt;\">．强化扶贫对象特惠扶持政策，在安排扶贫项目资金时，要全部用于贫困村、贫困户，并实行<span lang=\"EN-US\">“</span>五优先、五到户<span lang=\"EN-US\">”</span>原则（贫困优先，首扶到户；项目优先，资金到户；产业优先，培育到户；培训优先，提升到户；帮扶优先，结对到户），优先解决贫困群众最困难、最突出的问题。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（三）落实项目挂包责任。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">1</span><span style=\"font-family:仿宋;font-size:16pt;\">．实行<span lang=\"EN-US\">“</span>省包片、市（州）包县（市、区）、县（市、区）包项目<span lang=\"EN-US\">”</span>的扶贫项目挂包责任制，做到分级负责、分层把关、上下联动、一级抓一级、层层抓落实的项目挂包责任制。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">2</span><span style=\"font-family:仿宋;font-size:16pt;\">．县级扶贫移民工作部门作为扶贫项目管理主体，要按照<span lang=\"EN-US\">“</span>谁主管、谁负责<span lang=\"EN-US\">”</span>的原则，切实履行管理主体责任，把责任分解到具体岗位、细化到具体环节、落实到具体人员，确保每个扶贫项目实施乡（镇）、村有扶贫干部抓落实。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（四）<span lang=\"EN-US\">“</span>五级<span lang=\"EN-US\">”</span>公示公告制。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">1.</span><span style=\"font-family:仿宋;font-size:16pt;\">对当年启动实施的各类扶贫项目，做到在省、市（州）、县（市、区）、乡（镇）、村五级进行公开、公示、公告。省、市（州）、县（市、区）主要利用报纸、网站、电视等进行公告，乡（镇）、村主要利用政务公开栏、村务公开栏、项目标识牌等进行公示。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">2.</span><span style=\"font-family:仿宋;font-size:16pt;\">项目实施村在项目实施前要将项目名称、实施地点、建设内容及规模、实施期限、资金来源及构成、受益对象、补助标准、补助环节、实施单位及责任人、政府采购及招投标情况、预期目标、项目实施结果、投诉方式等在实施区公示公告<span lang=\"EN-US\">7</span>天以上。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（五）加强阳光作业，落实监督机制。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">1.</span><span style=\"font-family:仿宋;font-size:16pt;\">坚持对扶贫项目资金使用管理全过程实行信息公开和阳光操作，保证扶贫项目资金分配、管理、使用的各个环节公开透明。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">2.</span><span style=\"font-family:仿宋;font-size:16pt;\">落实群众的知情权、参与权、监督权，充分发挥群众<span lang=\"EN-US\">“</span>决策主体、建设主体、管护主体<span lang=\"EN-US\">”</span>的作用，在项目申报、建设、管理环节让群众全程参与，确保扶贫项目资金使用安全，提高扶贫项目资金使用效益。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">3.</span><span style=\"font-family:仿宋;font-size:16pt;\">建立健全扶贫移民系统来信、来访、来电、网络<span lang=\"EN-US\">“</span>四位一体<span lang=\"EN-US\">”</span>的信访举报网络，畅通省、市（州）、县（市、区）、乡（镇）投诉及受理渠道，主动接受社会群体的全方位监督。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（六）强化移民政策梳理、解读。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">1.</span><span style=\"font-family:仿宋;font-size:16pt;\">加强对扶贫移民干部在相关政策和业务工作等方面实行分级分层培训，着力提升干部工作素质和履职能力，提高工作执行力。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">2.</span><span style=\"font-family:仿宋;font-size:16pt;\">广泛开展政策法规调研，进一步细化完善相关管理和操作规范，按照统筹兼顾、综合配套原则，推进工作改革创新。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（七）从严做好移民实物指标调查。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">1.</span><span style=\"font-family:仿宋;font-size:16pt;\">坚持提前介入、加强督导、优质服务，认真落实全程跟踪检查考核工作，着力上下协同配合，确保规范有序推进移民前期工作。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">2.</span><span style=\"font-family:仿宋;font-size:16pt;\">坚持以民为本，严格执行征地移民补偿安置政策标准，依法遵规落实好对涉及移民群众切身利益的移民实物指标调查、安置意愿征求等工作。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（八）严格执行移民安置规划（计划）、单项工程设计变更按程序报批。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-align:left;text-indent:31.7pt;margin:0cm 0cm 0pt;mso-layout-grid-align:none;mso-char-indent-count:2.0;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:仿宋;font-size:16pt;mso-font-kerning:0pt;mso-ansi-language:ZH-CN;\"><span style=\"font-family:\'Times New Roman\';\">1.严格落实移民安置规划。严格执行移民安置方案、补偿标准、政策、移民工程项目建设标准，不得随意调整和变更。<o:p></o:p></span></span></p>\r\n<p style=\"text-align:left;text-indent:31.7pt;margin:0cm 0cm 0pt;mso-layout-grid-align:none;mso-char-indent-count:2.0;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:仿宋;font-size:16pt;mso-font-kerning:0pt;mso-ansi-language:ZH-CN;\"><span style=\"font-family:\'Times New Roman\';\">2.按期完成移民安置年度计划。制定《大中型水利水电工程移民安置年度计划完成情况考核办法》，明确考核内容，设定量化标准，逗硬考核，确保年度计划任务按期完成。<o:p></o:p></span></span></p>\r\n<p style=\"text-align:left;text-indent:31.7pt;margin:0cm 0cm 0pt;mso-layout-grid-align:none;mso-char-indent-count:2.0;\" class=\"MsoNormal\" align=\"left\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;mso-font-kerning:0pt;mso-ansi-language:ZH-CN;\">3.严格执行单项工程设计变更程序管理。依据《四川省大中型水利水电工程移民安置实施阶段设计管理办法》，加强对大中型水利水电工程移民安置实施阶段设计管理工作，严格执行设计变</span><span style=\"font-family:仿宋;font-size:16pt;\">更各方职责、设计变更划分、工作程序等规定，规范移民安置实施阶段设计行为。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（九）严格竣工结算，加强资金管理。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">1.</span><span style=\"font-family:仿宋;font-size:16pt;\">健全完善内部管理机制，加强扶贫移民资金年度计划管理，确保资金及时到位。开展扶贫移民资金年度计划执行情况自查自纠工作，充分发挥移民资金的使用效益，确保资金安全。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">2.</span><span style=\"font-family:仿宋;font-size:16pt;\">加强扶贫移民资金的拨付管理，特别是移民个人补偿部分要按政策规定及时兑付，确保移民的合法权益；对完工的单项工程要及时开展竣工决算，确保工程款拨付到位，避免因工程款未及时拨付而影响民工工资兑付所造成的社会不稳定。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（十）加强人口动态管理，及时审核新增后扶人口。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">1.</span><span style=\"font-family:仿宋;font-size:16pt;\">督促指导各市（州）移民工作部门及时将搬迁安置人口情况上报省局审核。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">2.</span><span style=\"font-family:仿宋;font-size:16pt;\">强化沟通衔接，对纳入国家后扶指标的人口及时兑现后扶政策，对没有纳入国家后扶指标的及时提供相关资料。工程蓄水验收后及时将生产安置移民分解到村组，上报省局审核。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\">3.</span><span style=\"font-family:仿宋;font-size:16pt;\">将人口动态管理工作纳入后扶监测评估工作的重点内容，制定《人口动态管理暂行办法》，了解掌握移民后扶对象的动态变化，规范全省后扶人口管理。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:黑体;font-size:16pt;mso-hansi-font-family:黑体;\">三、落实责任<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（一）严格落实领导责任。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">省局进一步深化专项整治工作由局党组书记、局长张谷同志负总责，分管局领导牵头负责，相关处室具体负责，齐心协力狠抓各项整治工作落到实处。各市（州）、县（市、区）也要按照整治工作要求加强领导，细化工作措施，明确工作职责，落实工作责任，上下联动，从严整治，抓出成效。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（二）严格落实督查责任。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">省局成立<span lang=\"EN-US\">10</span>项专项整治工作督查检查组，分别由分管局领导带队，各相关处室参与，对照进一步深化专项整治工作重点要求，创新工作方法，细化工作举措，扎实推进专项整治工作落实。各督查检查组于<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">25</span>日前开展全面监督检查，<span lang=\"EN-US\">9</span>月底前结束。各市（州）、县（市、区）也要成立督查组，分别对辖区内的专项整治工作加强督查检查，确保立行立改，立竿见影。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:23.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:1.49;\" class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal;\"><span style=\"font-family:楷体;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">（三）严格落实信息报送责任。<span lang=\"EN-US\"><o:p></o:p></span></span></span></b></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;tab-stops:382.95pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">要畅通信息渠道，善于发现总结工作经验和方法，确保优质高效推进专项整治工作。各督查检查组要及时将工作开展情况汇总上报分管局领导、局党组。各市（州）每月<span lang=\"EN-US\">8</span>日前要将整治工作情况以电子文档上报省局机关党委，<span lang=\"EN-US\">9</span>月<span lang=\"EN-US\">20</span>日前上报书面总结，重大事项要及时报告（联系人：王胜，联系电话：<span lang=\"EN-US\">86603071</span>，<span lang=\"EN-US\">QQ</span>：<span lang=\"EN-US\">554533247</span>）。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;layout-grid-mode:char;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\"><o:p><span style=\"font-family:\'Times New Roman\';\">&nbsp;</span></o:p></span></p>\r\n<p style=\"text-indent:31.7pt;margin:0cm 0cm 0pt;mso-char-indent-count:2.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">附件：<span style=\"letter-spacing:-0.2pt;\">省扶贫移民局进一步深化专项整治工作切实解决执行不</span></span></span><span style=\"font-family:仿宋;letter-spacing:-0.2pt;font-size:16pt;\"><span style=\"font-family:\'Times New Roman\';\">力和侵害群众切身利益问题督查检查分工表<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n<p style=\"text-indent:79.25pt;margin:0cm 0cm 0pt;layout-grid-mode:char;mso-char-indent-count:5.0;\" class=\"MsoNormal\"><span style=\"font-family:仿宋;font-size:16pt;\" lang=\"EN-US\"><o:p><span style=\"font-family:\'Times New Roman\';\">&nbsp;</span></o:p></span></p>\r\n<p style=\"text-indent:79.25pt;margin:0cm 0cm 0pt;layout-grid-mode:char;mso-char-inde