-height:12pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-element:frame;mso-element-frame-hspace:9.0pt;mso-element-wrap:around;mso-element-anchor-vertical:page;mso-element-anchor-horizontal:margin;mso-element-left:center;mso-element-top:159.1pt;mso-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:12pt;\" lang=\"EN-US\">“</span><span style=\"font-family:仿宋;font-size:12pt;\">五级<span lang=\"EN-US\">”</span>公示公告制<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n</td>\r\n<td style=\"border-bottom:windowtext 1pt solid;border-left:#ece9d8;padding-bottom:0cm;background-color:transparent;padding-left:5.4pt;width:243.55pt;padding-right:5.4pt;height:27.7pt;border-top:#ece9d8;border-right:windowtext 1pt solid;padding-top:0cm;mso-border-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;mso-border-top-alt:solid windowtext .5pt;\" width=\"325\">\r\n<p style=\"line-height:12pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-element:frame;mso-element-frame-hspace:9.0pt;mso-element-wrap:around;mso-element-anchor-vertical:page;mso-element-anchor-horizontal:margin;mso-element-left:center;mso-element-top:159.1pt;mso-height-rule:exactly;\" class=\"MsoNormal\"><span style=\"font-family:\'Times New Roman\';\"><span style=\"font-family:仿宋;font-size:12pt;\" lang=\"EN-US\">1.</span><span style=\"font-family:仿宋;font-size:12pt;\">对当年实施的各类扶贫项目，省市县乡村要实行公示公告。<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n</td>\r\n<td style=\"border-bottom:windowtext 1pt solid;border-left:#ece9d8;padding-bottom:0cm;background-color:transparent;padding-left:5.4pt;width:47.6pt;padding-right:5.4pt;height:27.7pt;border-top:#ece9d8;border-right:windowtext 1pt solid;padding-top:0cm;mso-border-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;mso-border-top-alt:solid windowtext .5pt;\" rowspan=\"2\" width=\"63\">\r\n<p style=\"text-align:center;line-height:12pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-element:frame;mso-element-frame-hspace:9.0pt;mso-element-wrap:around;mso-element-anchor-vertical:page;mso-element-anchor-horizontal:margin;mso-element-left:center;mso-element-top:159.1pt;mso-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family:仿宋;font-size:12pt;\"><span style=\"font-family:\'Times New Roman\';\">刘维嘉<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n</td>\r\n<td style=\"border-bottom:windowtext 1pt solid;border-left:#ece9d8;padding-bottom:0cm;background-color:transparent;padding-left:5.4pt;width:61.3pt;padding-right:5.4pt;height:27.7pt;border-top:#ece9d8;border-right:windowtext 1pt solid;padding-top:0cm;mso-border-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;mso-border-top-alt:solid windowtext .5pt;\" rowspan=\"2\" width=\"82\">\r\n<p style=\"text-align:center;line-height:12pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-element:frame;mso-element-frame-hspace:9.0pt;mso-element-wrap:around;mso-element-anchor-vertical:page;mso-element-anchor-horizontal:margin;mso-element-left:center;mso-element-top:159.1pt;mso-height-rule:exactly;\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family:仿宋;font-size:12pt;\"><span style=\"font-family:\'Times New Roman\';\">扶贫开发指导处<span lang=\"EN-US\"><o:p></o:p></span></span></span></p>\r\n</td>\r\n</tr>\r\n<tr style=\"height:27pt;mso-yfti-irow:9;\">\r\n<td style=\"border-bottom:windowtext 1pt solid;border-left:#ece9d8;padding-bottom:0cm;background-color:transparent;padding-left:5.4pt;width:243.55pt;padding-right:5.4pt;height:27pt;border-top:#ece9d8;border-right:windowtext 1pt solid;padding-top:0cm;mso-border-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;mso-border-top-alt:solid windowtext .5pt;\" width=\"325\">\r\n<p style=\"line-height:12pt;margin:0cm 0cm 0pt;mso-line-height-rule:exactly;mso-element:frame;ms','data/uploadfile/238/20140716/20140716092253.doc'