INSERT INTO toa_news VALUES ('28','0','0','','关于认真填报5月份《安排部署工作完成情况统计表》的通知','<p class=\"p0\" style=\"margin-bottom:0pt;margin-top:0pt;\"><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">各处（室、委）、中心</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">：</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\"><?xml:namespace prefix = \"o\" ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></span></p>\r\n<p class=\"p0\" style=\"margin-bottom:0pt;margin-top:0pt;line-height:28pt;text-indent:30.75pt;\"><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">根据局主要领导指示，办公室将</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">2014</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">年</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">5</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">月份安排部署的工作和</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">2014</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">年</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">5</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">月统计的以前尚未完成的工作一并进行了梳理、汇总，形成了《安排部署工作完成情况统计表》</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">（</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">请下载附件</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">）</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">，现印送你们，请认真填写</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">涉及你们处（室、委）、中心的</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">“办理（完成）情况”，于</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">7</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">月</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">1</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">日</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">12</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">：</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">00</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">前送办公室（</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">白楠</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">）。在填写“办理（完成）情况”时，要注意把握好以下</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">5</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">点：</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p class=\"p0\" style=\"margin-bottom:0pt;margin-top:0pt;line-height:28pt;text-indent:30.75pt;\"><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">一、若工作已完成</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">&nbsp;</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">，则需写明完成时间；若已形成上报或下发文件，还需注明文件文号。例：“已完成，</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">10.10</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">川扶贫移民发〔</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">2013</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">〕</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">666</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">号”。</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p class=\"p0\" style=\"margin-bottom:0pt;margin-top:0pt;line-height:28pt;text-indent:30.75pt;\"><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">二、若工作未完成，则需写明工作推进情况。例：“正在征求省级相关部门意见，待修改完善后提交局长办公会议审议”。</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p class=\"p0\" style=\"margin-bottom:0pt;margin-top:0pt;line-height:28pt;text-indent:30.75pt;\"><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">三、若工作未按时完成，则需写明未按时完成理由、目前工作进展情况。例：“因省政府未及时批复，致使该项工作未按时完成；待批复下来后，立即开展”。</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p class=\"p0\" style=\"margin-bottom:0pt;margin-top:0pt;line-height:28pt;text-indent:30.75pt;\"><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">四、配合处室应主动与牵头处室沟通协调，详细了解工作开展情况，以便填写准确。</span><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p class=\"p0\" style=\"margin-bottom:0pt;margin-top:0pt;line-height:28pt;text-indent:30.75pt;\"><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">五、语言表述要言简意赅、一目了然。</span></p>\r\n<p class=\"p0\" style=\"margin-bottom:0pt;margin-top:0pt;line-height:28pt;text-indent:30.75pt;\"><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 办公室</span></p>\r\n<p class=\"p0\" style=\"margin-bottom:0pt;margin-top:0pt;line-height:28pt;text-indent:30.75pt;\"><span style=\"font-size:16pt;font-family:\'仿宋\';mso-spacerun:\'yes\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014年6月27日</span></p>','data/uploadfile/239/20140627/20140627082821.doc','4','2014-06-27 16:29:30','239','0');
INSERT INTO toa_news VALUES ('34','0','张谷,刘兵,邹积立,何智彬,向伟益,刘维嘉,张华林,杨晖,都勤,廖蔚,何大清,郭全喜,张海鹏,汪社林,韩峰,曾文兵,唐义,罗薇,陈彦,高潭,朱蓉,王丹,李灵英,包文,刘燕,牟敏,李华聪,蒋蓉,王正洪,覃佳,李庆友,蒋光文,张潇元,彭静耘,姚立,曾磊,雷蕾,蒲熹漫,杨邦华,王胜,刘晓春,朱建凌,向兴华,郑持平,罗斯华,张晓东,王鹏,冯玲,张德华,曾小琴','','关于开展歌咏活动、书画摄影展和读书行动系列活动的通知','<div style=\"layout-grid:15.6pt none;\" class=\"Section0\"><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\"> <div style=\"layout-grid:15.6pt none;\" class=\"Section0\">\r\n<p style=\"text-align:center;line-height:32pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'方正小标宋简体\';font-size:22pt;mso-spacerun:\'yes\';\">关于开展歌咏活动、书画摄影展</span><span style=\"font-family:\'方正小标宋简体\';font-size:22pt;mso-spacerun:\'yes\';\"><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></span></p>\r\n<p style=\"text-align:center;line-height:32pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'方正小标宋简体\';font-size:22pt;mso-spacerun:\'yes\';\">和读书行动系列活动的通知</span><span style=\"font-family:\'宋体\';font-size:10.5pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">各支部：</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:32pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">根据中共四川省直机关工委《关于开展“治蜀兴川、圆梦中华”歌咏活动的通知》（</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">川直工委〔2014〕57号</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">）、</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">《关于举办“人文机关、魅力天府”第二届书画摄影作品展的通知》（川直工委〔2014〕58号）和四川省直属机关工会委员会《关于开展“争当学习型职工读书行动”的通知》（</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">川直工</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">办</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">〔2014〕</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">19</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">号</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">）文件要求，</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">2014年8月省直机关将开展歌咏活动、书画摄影展和读书行动系列活动，现将有关事项通知如下：</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'黑体\';font-size:16pt;mso-spacerun:\'yes\';\">&nbsp;&nbsp;&nbsp;&nbsp;一、“治蜀兴川、圆梦中华”歌咏活动</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-family:\'楷体\';font-size:16pt;font-weight:bold;mso-spacerun:\'yes\';\">（一）活动内容：</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">为庆祝中华人民共和国成立65周年，进一步凝聚起省直机关“干在实处、走在前列”的正能量，省直机关工委决定在省直机关开展“治蜀兴川、圆梦中华”歌咏活动。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">歌咏活动以</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">厅局为单位组队参赛，参赛人数不得低于<span style=\"font-family:\'Times New Roman\';\">50</span><span style=\"font-family:仿宋_GB2312;\">人</span></span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">，</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">分</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">为</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">歌咏比赛和歌咏晚会两个阶段</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">，</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">8月下旬进行分组比赛</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">，</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">根据比赛成绩排名由组委会选出15－20个参赛队参加</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">9月下旬的</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">歌咏晚会演出。</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'楷体\';font-size:16pt;font-weight:bold;mso-spacerun:\'yes\';\">&nbsp;&nbsp;&nbsp;&nbsp;（二）相关要求：</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">局机关各支部和外资中心、扶贫开发支部，每个支部选派2-3人、移民开发中心和规划安置中心支部选派10-15人，8月上旬进行集中排练。请各支部于2014年7月25日前将人员名单报机关党委。联系人：王胜，</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">电子邮箱：</span><span><a href=\"mailto:287811921@QQ.com\"><span style=\"font-family:\'仿宋_GB2312\';color:#0000ff;font-size:16pt;text-decoration:underline;mso-spacerun:\'yes\';\" class=\"15\">554533247@QQ.com</span></a></span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'黑体\';font-size:16pt;mso-spacerun:\'yes\';\">&nbsp;&nbsp;&nbsp;&nbsp;二、“人文机关、魅力天府”第二届书画摄影作品展</span><span style=\"font-family:\'黑体\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:35.84pt;margin-bottom:0pt;margin-right:0.945pt;\" class=\"p0\"><span style=\"font-family:\'楷体\';font-size:16pt;font-weight:bold;mso-spacerun:\'yes\';\">（一）活动内容：</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">为集中展示省直机关文化建设的丰硕成果，充分展现改革开放新成效、人民群众新生活、机关干部新气象，省直机关工委决定于2014年8月</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">下旬在</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">四川科技馆举行举办“人文机关、魅力天府”四川省直机关第二届书画摄影作品展。党的关系隶属省直机关工委的省直各部门（单位）的党员干部职工（含离退休干部职工）均可参赛。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:34.88pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">作品报送要求：</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:34.88pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">1.内容积极向上，有时代特色。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:34.88pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">2.书法作品字体不作要求，形式以毛笔书法为主，提倡自主创新。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:34.88pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">3.绘画作品画种不限（国画、油画、素描、漫画、速写、剪纸、水粉、水彩等类型均可）。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:34.88pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">4.作品规格不作要求。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:34.88pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">5.投稿作品必须是作者自行完成的完整创作，如发现有由他人代笔或剽窃他人作品者，一律取消参评资格。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:34.88pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">6.参赛作品可以另附作品说明（如：思想、精神、寓意）。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:34.88pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">7.递交的作品由省直机关工委宣传部负责保存，有意取回稿件者请明确标注。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:34.88pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">8.所有作品必须进行装裱，并在作品背面右下角注明作品类型,作品名称,作者姓名、工作单位和联系电话。摄影作品请一律用镜框装裱；美术和书法作品装裱形式不限，以方便上墙为原则。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:32pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'楷体\';font-size:16pt;font-weight:bold;mso-spacerun:\'yes\';\">（二）相关要求：</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">以支部为单位统一报名，请各支部于2014年8月1日前将作品报送机关党委，并在机关内部进行初展，评选优秀作品代表我局参展。</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\">联系人：王胜，</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">电话：86603071。</span><span style=\"font-family:\'仿宋\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'黑体\';font-size:16pt;mso-spacerun:\'yes\';\">&nbsp;&nbsp;&nbsp;&nbsp;三、争当学习型职工读书行动</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:32pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'楷体\';font-size:16pt;font-weight:bold;mso-spacerun:\'yes\';\">（一）活动内容：</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">为深入学习贯彻党的十八大、十八届三中全会和习近平总书记系列重要讲话精神以及中国工会十六大、全总十六届二次执委会精神，进一步推动省直单位职工素质建设工程深入开展，省直机关工会决定在广大职工中开展“争当学习型职工读书行动”。通过开展学习会、读书会、写心得体会、诗歌朗诵、互赠一本好书等形式丰富机关文化生活，并选择优秀征文推荐到全总，参加“读书，让梦想成真”主题征文活动。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:32pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'楷体\';font-size:16pt;font-weight:bold;mso-spacerun:\'yes\';\">（二）相关要求：</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">以支部为单位自行开展活动，每个支部推荐一篇优秀征文，请各支部于2014年8月15日前将活动开展情况和优秀征文（3000字以内）报机关党委。联系人：韩敏，电子邮箱：</span><span><a href=\"mailto:287811921@QQ.com\"><span style=\"font-family:\'仿宋_GB2312\';color:#0000ff;font-size:16pt;text-decoration:underline;mso-spacerun:\'yes\';\" class=\"15\">287811921@QQ.com</span></a></span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:32pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">特此通知。</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;text-indent:32pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">附：“争当学习型职工读书行动”推荐书目</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"text-align:center;line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;机关党委</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"text-align:right;line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\">2014年7月17日</span><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n<p style=\"text-align:right;line-height:28pt;margin-top:0pt;margin-bottom:0pt;\" class=\"p0\"><span style=\"font-family:\'仿宋_GB2312\';font-size:16pt;mso-spacerun:\'yes\';\"><o:p></o:p></span></p>\r\n</div>\r\n<!--EndFragment--></span></div>','data/uploadfile/92/20140717/20140717060601.zip','4','2014-07-17 14:04:27','92','0');
INSERT INTO toa_news VALUES ('35','0','0','','关于召开2014年度第三次党组织中心组集体学习（扩大）会的通知','请各位领导、各处室与会同志准时参会。','data/uploadfile/238/20140718/20140718023419.doc','4','2014-07-18 10:35:39','238','0');
