de:char;line-height:30pt;text-indent:31.5pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\"><span style=\"font-size:16pt;font-family:仿宋;\">按照张谷局长“请局处领导按分工抓落实”的批示，现将全国扶贫办主任座谈会要求落实的工作事项通知如下，请根据局领导分工和各处（室、委、中心）职责，结合工作实际，认真贯彻落实。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"layout-grid-mode:char;line-height:30pt;text-indent:31.5pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\"><span style=\"font-size:16pt;font-family:仿宋;\">特此通知。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"layout-grid-mode:char;line-height:30pt;text-indent:31.5pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\"><span lang=\"EN-US\" style=\"font-size:16pt;font-family:仿宋;\"><o:p>&nbsp;</o:p></span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"layout-grid-mode:char;line-height:30pt;text-indent:31.5pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\"><span style=\"font-size:16pt;font-family:仿宋;\">附：全国扶贫办主任座谈会要求落实的工作事项<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"layout-grid-mode:char;line-height:30pt;text-indent:31.5pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\"><span lang=\"EN-US\" style=\"font-size:16pt;font-family:仿宋;\"><o:p>&nbsp;</o:p></span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"layout-grid-mode:char;line-height:30pt;text-indent:31.5pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;\"><span lang=\"EN-US\" style=\"font-size:16pt;font-family:仿宋;\"><o:p>&nbsp;</o:p></span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"layout-grid-mode:char;line-height:30pt;text-indent:328pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;mso-char-indent-count:20.5;\"><span style=\"font-size:16pt;font-family:仿宋;\">法规处<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"layout-grid-mode:char;line-height:30pt;text-indent:296pt;mso-line-height-rule:exactly;mso-layout-grid-align:none;mso-char-indent-count:18.5;\"><span lang=\"EN-US\" style=\"font-size:16pt;font-family:仿宋;\">2014</span><span style=\"font-size:16pt;font-family:仿宋;\">年<span lang=\"EN-US\">7</span>月<span lang=\"EN-US\">21</span>日<span lang=\"EN-US\"><o:p></o:p></span></span></p>','data/uploadfile/252/20140722/20140722012832.doc','4','2014-07-22 08:59:28','252','0');
